pragma solidity 0.4.24;

import "../utils/LibBytes/LibBytes.sol";
import "../tokens/ERC721Token/IERC721Token.sol";
import "./mixins/MTransfer.sol";


contract MixinTransfer is
    MTransfer
{

    using LibBytes for bytes;

    bytes4 constant internal ERC20_TRANSFER_SELECTOR = bytes4(keccak256("transfer(address,uint256)"));
    bytes4 constant internal ERC721_RECEIVED = bytes4(keccak256("onERC721Received(address,uint256,bytes)"));
    bytes4 constant internal ERC721_RECEIVED_OPERATOR = bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"));

    function onERC721Received(
        address,
        uint256,
        bytes memory
    )
        public
        pure
        returns(bytes4)
    {
        return ERC721_RECEIVED;
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    )
        public
        pure
        returns(bytes4)
    {
        return ERC721_RECEIVED_OPERATOR;
    }

    function transferERC20Token(
        address token,
        address to,
        uint256 amount
    )
        internal
    {
        // Transfer tokens.
        // We do a raw call so we can check the success separate
        // from the return data.
        bool success = token.call(abi.encodeWithSelector(
            ERC20_TRANSFER_SELECTOR,
            to,
            amount
        ));
        require(
            success,
            "TRANSFER_FAILED"
        );

        // Check return data.
        // If there is no return data, we assume the token incorrectly
        // does not return a bool. In this case we expect it to revert
        // on failure, which was handled above.
        // If the token does return data, we require that it is a single
        // value that evaluates to true.
        assembly {
            if returndatasize {
                success := 0
                if eq(returndatasize, 32) {
                    // First 64 bytes of memory are reserved scratch space
                    returndatacopy(0, 0, 32)
                    success := mload(0)
                }
            }
        }
        require(
            success,
            "TRANSFER_FAILED"
        );
    }

    function transferERC721Token(
        bytes memory assetData,
        address to
    )
        internal
    {
        // Decode asset data.
        address token = assetData.readAddress(16);
        uint256 tokenId = assetData.readUint256(36);
        bytes memory receiverData = assetData.readBytesWithLength(100);
        IERC721Token(token).safeTransferFrom(
            address(this),
            to,
            tokenId,
            receiverData
        );
    }
}

